function replaceSince(a){var f=a.firstChild.data,d,e,b,c;if(a.title=f,d=new Date(Date.now()),e=new Date(f),b=d.getTime()-e.getTime(),b<60*60*1e3){a.firstChild.data=Math.floor(b/(60*1e3))+" minutes ago";return}if(b<24*60*60*1e3){a.firstChild.data=Math.floor(b/(60*60*1e3))+" hours ago";return}if(b<28*24*60*60*1e3){a.firstChild.data=Math.floor(b/(24*60*60*1e3))+" days ago";return}if(c=d.getFullYear()*12+d.getMonth()+1-(e.getFullYear()*12+e.getMonth()+1),c<12){a.firstChild.data=c+" months ago";return}if(c>0){a.firstChild.data=Math.trunc(c/12)+" years ago";return}a.firstChild.data="now"}